import { useEffect } from 'react';
import HeaderComponent from './Components/Header/HeaderComponent';
import MenuContainerComponent from './Components/MenuContainer/MenuContainerComponent';

import {
  AccountBalanceWalletRounded,
  Chat,
  Favorite,
  HomeRounded,
  Settings,
  SummarizeRounded
} from '@mui/icons-material';

import './Styles/App.css';

function App() {
  useEffect(() => {
    // Obter elemento da tag li que está dentro de menu
    const menuLi = document.querySelectorAll("#menu li")

    function setMenuActive() {
      menuLi.forEach((n) => n.classList.remove("active"));
      this.classList.add("active");
    }

    // Para cada elemento do menu de loop
    menuLi.forEach(n => n.addEventListener('click', setMenuActive))
  }, [])

  return (
    <div className="App">
      {/* Header Section */}

      <HeaderComponent />

      {/* Main Container */}

      <main>
        <div className="mainContainer"></div>
        <div className="rightMenu"></div>
      </main>

      {/* Bottom Menu */}

      <div className="bottomMenu">
        <ul id="menu">
          {/* prettier-ignore */}
          <MenuContainerComponent link={"#"} icon={<HomeRounded />} />
          {/* prettier-ignore */}
          <MenuContainerComponent link={"#"} icon={<Chat />} />
          {/* prettier-ignore */}
          <MenuContainerComponent link={"#"} icon={<AccountBalanceWalletRounded />} />
          {/* prettier-ignore */}
          <MenuContainerComponent link={"#"} icon={<Favorite />} />
          {/* prettier-ignore */}
          <MenuContainerComponent link={"#"} icon={<SummarizeRounded />} />
          {/* prettier-ignore */}
          <MenuContainerComponent link={"#"} icon={<Settings />} />

          <div className="indicator"></div>
        </ul>
      </div>
    </div>
  );
}

export default App;
